window.bookSummaryJSON = "<p>If you’re at all responsible for your company’s success, you can’t just be a hard-charging entrepreneur or a motivating, encouraging leader. You have to be both! </p> <p>If you’re at all responsible for your company’s success, you can’t just be a hard-charging entrepreneur or a motivating, encouraging leader. You have to be both! </p> <p>This book presents Dave’s playbook for creating work that matters; building an incredible group of passionate, empowered team members; and winning the race with steady momentum that will roll over any obstacle. </p> <p>Regardless of your business goals, you’ll discover that anyone can lead any venture to unbelievable growth and prosperity through Dave’s common sense, counterculture, EntreLeadership principles! </p>"; 
